import React from 'react';
        import { TextField } from "@mui/material";




        function Project() {
        return (
<div>
    <center><h1>New project</h1></center>
        <p>Title:   {' '} <TextField/></p>
    <p>About: {' '}
        <TextField rows={2}/></p>
    <p>Languages: {' '}
    <TextField/></p>
    <p>GitHub link: {' '}
        <TextField/></p>
</div>
        );
        }
        export default Project;
